import _AxiosInstance from '../Store/_AxiosInstance';

export const FETCH_TRENDING = 'FETCH_TRENDING';
export const FETCH_NETFLIX_ORIGINALS = 'FETCH_NETFLIX_ORIGINALS';


export function fetchTrending() {
  const request = _AxiosInstance.get(`/trending/all/week?api_key=028e8ea4ca7d9164d085c9238979098b&language=en-US`);

  return {
    type: FETCH_TRENDING,
    payload: request,
  };
}

export function fetchNetflixOriginals() {
  const request = _AxiosInstance.get(`/discover/tv?api_key=028e8ea4ca7d9164d085c9238979098b&language&with_networks=213`);

  return {
    type: FETCH_NETFLIX_ORIGINALS,
    payload: request,
  };
}
